import useFetch from './hooks/Header'

function App() {
  const {loding, error, data } = useFetch('http://localhost:1337/api/home')

  if (loding) return <p>loading...</p>
  if (error) return <p> Error</p>
  return (
    <div>
     hello world
     {data.attributes?.map(({Title,SubTitle}) => {
      return (
        <div> {Title} {SubTitle} </div>
      )
     }
     )}
    </div>
  );
}

export default App;
